DROP TABLE IF EXISTS public.chapter_access;
DROP TABLE IF EXISTS public.chapter_version;
DROP TABLE IF EXISTS public.chapter;
DROP TABLE IF EXISTS public.project;
DROP TABLE IF EXISTS public.person;
DROP TABLE IF EXISTS public.company;
DROP TABLE IF EXISTS public.language;

-- CREATE DATABASE ctrl
--  WITH OWNER = postgres
--       ENCODING = 'UTF8'
--       TABLESPACE = pg_default
--       CONNECTION LIMIT = -1;

-- Table: public.language

CREATE TABLE public.language
(
  language_id serial NOT NULL,
  language_name text NOT NULL,
  CONSTRAINT pk_language PRIMARY KEY (language_id)
);

-- Table: public.company

CREATE TABLE public.company
(
  company_id serial NOT NULL,
  company_name character varying(255) NOT NULL,
  CONSTRAINT pk_company_id PRIMARY KEY (company_id),
  CONSTRAINT unique_company_name UNIQUE (company_name)
);

CREATE UNIQUE INDEX idx_company_id
  ON public.company
  USING btree
  (company_id);

-- Table: public.person

CREATE TABLE public.person
(
  person_id serial NOT NULL,
  person_username text NOT NULL,
  person_company_id integer,
  person_language_id integer NOT NULL DEFAULT 1,
  CONSTRAINT pk_person PRIMARY KEY (person_id),
  CONSTRAINT fk_person_company FOREIGN KEY (person_company_id)
  REFERENCES public.company (company_id) MATCH SIMPLE
  ON UPDATE CASCADE ON DELETE CASCADE,
  CONSTRAINT fk_person_language FOREIGN KEY (person_language_id)
  REFERENCES public.language (language_id) MATCH SIMPLE
  ON UPDATE CASCADE ON DELETE CASCADE,
  CONSTRAINT person_username UNIQUE (person_username)
);

CREATE INDEX fki_person_company
  ON public.person
  USING btree
  (person_company_id);


-- Table: public.project

CREATE TABLE public.project
(
  project_id serial NOT NULL,
  project_company_id integer NOT NULL,
  project_name character varying(255) NOT NULL,
  CONSTRAINT pk_project PRIMARY KEY (project_id),
  CONSTRAINT fk_project_company FOREIGN KEY (project_company_id)
  REFERENCES public.company (company_id) MATCH SIMPLE
  ON UPDATE NO ACTION ON DELETE NO ACTION
);

CREATE INDEX fki_project_company
  ON public.project
  USING btree
  (project_company_id);

-- Table: public.chapter

CREATE TABLE public.chapter
(
  chapter_id serial NOT NULL,
  chapter_project_id integer NOT NULL,
  chapter_name text NOT NULL,
  CONSTRAINT pk_textpart PRIMARY KEY (chapter_id),
  CONSTRAINT fk_chapter_project FOREIGN KEY (chapter_project_id)
  REFERENCES public.project (project_id) MATCH SIMPLE
  ON UPDATE NO ACTION ON DELETE NO ACTION
);

CREATE INDEX fki_chapter_project
  ON public.chapter
  USING btree
  (chapter_project_id);

-- Table: public.chapter_version

CREATE TABLE public.chapter_version
(
  chapter_version_id serial NOT NULL,
  chapter_version_chapter_id integer,
  chapter_version_number integer,
  chapter_version_create_date timestamp,
  chapter_version_person_id integer,
  chapter_version_appversion character varying(10),
  CONSTRAINT pk_textpart_version PRIMARY KEY (chapter_version_id),
  CONSTRAINT fk_chapter_version_chapter FOREIGN KEY (chapter_version_chapter_id)
  REFERENCES public.chapter (chapter_id) MATCH SIMPLE
  ON UPDATE CASCADE ON DELETE CASCADE,
  CONSTRAINT "fk_chapter_version_person_id-person_id" FOREIGN KEY (chapter_version_person_id)
  REFERENCES public.person (person_id) MATCH SIMPLE
  ON UPDATE RESTRICT ON DELETE RESTRICT
);

CREATE INDEX fki_chapter_version_chapter
  ON public.chapter_version
  USING btree
  (chapter_version_chapter_id);

CREATE INDEX "fki_chapter_version_checkout_pid-person_id"
  ON public.chapter_version
  USING btree
  (chapter_version_person_id);

CREATE INDEX idx_chapter_version_chapter_id
  ON public.chapter_version
  USING btree
  (chapter_version_id, chapter_version_chapter_id);

-- Table: public.chapter_access

CREATE TABLE public.chapter_access
(
  chapter_access_person_id integer NOT NULL,
  chapter_access_chapter_id integer NOT NULL,
  CONSTRAINT pk_chapter_access PRIMARY KEY (chapter_access_person_id, chapter_access_chapter_id),
  CONSTRAINT fk_chapter_access_chapter FOREIGN KEY (chapter_access_chapter_id)
      REFERENCES public.chapter (chapter_id) MATCH SIMPLE
      ON UPDATE CASCADE ON DELETE CASCADE,
  CONSTRAINT fk_chapter_access_person FOREIGN KEY (chapter_access_person_id)
      REFERENCES public.person (person_id) MATCH SIMPLE
      ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE INDEX fki_chapter_access_chapter
  ON public.chapter_access
  USING btree
  (chapter_access_chapter_id);

CREATE INDEX fki_chapter_access_person
  ON public.chapter_access
  USING btree
  (chapter_access_person_id);


